import React from 'react'
import { Link } from 'react-router-dom'

export const PopularPosts = ({ post }) => {
    return (
        <div className='bg-stone-900'>
            <Link
                to={`${post._id}`}
                className='flex text-xs p-2 text-orange-100 hover:bg-stone-900  hover:text-white'
            >
                {post.title}
            </Link>
        </div>
    )
}
